  ["|cff33ffccBlizzard: \"Interface Options\"|r\n\nDo you want me to setup the recommended blizzard UI settings?\nThis will enable settings that can be found in the Interface section of your client.\nOptions like Buff Durations, Instant Quest Text, Auto Selfcast and others will be set."] = "|cff33ffccBlizzard: \"Opciones Interfaz\"|r\n\n¿Prefieres tener la configuración IU recomendida de Blizzard?\nSe activa la configuración que se encuentra en la sección de la Interfaz de tu cliente.\nOpciones como duración de Buffs, Texto de Misión Instantáneo, Autolanzarse Hechizos, y otros se configura.",
  ["|cff33ffccChat: \"Channels\"|r\n\nDo you want me to setup the chat channels of your chatframes?\nThis would set important or personal messages to the left chat\nand world channels and lootinformation to the right chat."] = "|cff33ffccChat: \"Canales\"|r\n\n¿Quieres que configuro los canales de chat para tu marco de chat?\nSe configura mensajes importantes o personales a la ventana de chat izquierda\ny los canales mundiales y información del botín a la ventana de chat derecha.",
  ["|cff33ffccChat: \"Layout\"|r\n\nDo you want me to adjust the layout of your chatframes?\nThis would make sure, that every window is placed on its dedicated position."] = "|cff33ffccChat: \"Disposición\"|r\n\n¿Quieres que ajusto la disposición de los marcos de chat?\nSe asegura que la ventana se pone en su posición destinada",
  ["|cff33ffccChat: \"Loot & Spam\"|r\n\nDo you want me to create and manage a specific Chatframe called \"Loot & Spam\"?\nThis chat will display world channels, loot information and miscellaneous messages,\nthat would otherwise clutter your main chatframe."] = "|cff33ffccChat: \"Botín y Spam\"|r\n\n¿Quieres que hago un marco de chat llamado \"Botín y Spam\"?\nLa ventana muestra los canales mundiales, información del botín y otros mensajes diversos\nque desordenaría tu marco de chat principal.",
  ["|cff33ffccKeybind Mode|r\nThis mode allows you to bind keyboard shortcuts to your actionbars.\nBy hovering a button with your cursor and pressing a key, the key will be assigned to that button.\nHit Escape on a button to remove bindings.\n\nPress Escape or click on an empty area to leave the keybind mode."] = "|cff33ffccModo del Teclado|r\nEste modo te permite configurar las teclas de tus barras de acción.\nPor pasar el puntero sobre un botón y presiona la tecla, se asigna a ese botón.\nPresiona Escape por un botón para quitar la configuracion de la tecla.\n\nPresiona Escape o haz clic en una área vacía para salir el modo del teclado.",
  ["|cff33ffccpf|cffffffffUI|cffcccccc Config"] = "|cff33ffccpf|cffffffffUI|cffcccccc Configuración",
  ["|cff33ffccpf|rUI: New version available! Have a look at http://shagu.org !"] = "|cff33ffccpf|rUI: ¡Nueva versión disponible! Descarga a http://shagu.org !",
  ["|cff33ffccUnlock Mode|r\nThis mode allows you to move frames by dragging them using the mouse cursor. Frames can be scaled by scrolling up and down.\nTo scale multiple frames at once (eg. raidframes), hold down the shift key while scrolling. Click into an empty space to go back to the pfUI menu."] = "|cff33ffccModo Desbloquear|r\nEste modo te permite moverse los marcos por usar el puntero. Los marcos se escala por rueda arriba o abajo.\nPara escalar varios marcos a la vez (como los marcos de banda), presiona shift mientras te lo muevas. Haz clic en una área vacía para regresar al menú pfUI.",
  ["|cffddddddIt's always safe to upgrade |cff33ffccpf|rUI. |cffddddddYou won't lose any of your configuration."] = "|cffddddddEs más seguro actualizar |cff33ffccpf|rUI. |cffddddddNo perderás tu configuración.",
